import hero from '../img/Jumbotron.png'
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const Home = () =>{
    return(
        <div className='jumbo'>
            <Container>
            <Row>
                <Col><img
              alt=""
              src={hero}
            /></Col>
            </Row>
            </Container>
        </div>
    )
}

export default Home
